import React from 'react';

import './Carousel.css';
import { CarouselData } from './CarouselData';

const Carousel = () => {
  return (
    <>
    {CarouselData.map((slide, index) => {
      return <img src={slide.image} alt="" />
    })}
    </>
  )
}

export default Carousel
